import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import NewsApp from "./home/NewsApp";
import WeatherApp from "./Weather-Forecast/weather";
import BlogApp from "./Add-Note/take_note";
import VirtualAssistant from "./bot/bot_ai";
import LoginPage from "./LoginPage"; // Assuming LoginPage.js is in src/

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/login" element={<LoginPage />} />
        <Route path="/newsApp" element={<NewsApp />} />
        <Route path="/weather" element={<WeatherApp />} />
        <Route path="/add-note" element={<BlogApp />} />
        <Route path="/bot" element={<VirtualAssistant />} />
        <Route path="/register" element={<div>Register Page (Placeholder)</div>} />
        <Route path="/" element={<LoginPage />} /> {/* Default route */}
      </Routes>
    </BrowserRouter>
  );
};

export default App;
